import {Grid} from '@mui/material';
import {Item} from '@mui/material';
import React from 'react';

export default function ItemListContainer() {
  return (
    <>
    <div>
    <Grid containter spacing={2}>
      <Grid item xs={6} md={4}>
        <Item>Lorem, ipsum dolor sit amet consectetur adipisicing elit. Earum vero veritatis assumenda alias, incidunt ullam suscipit cupiditate impedit deserunt dolorum quidem neque itaque soluta amet porro! Sapiente, repudiandae? Iste, repudiandae.</Item>
      </Grid>
    </Grid>
    </div>
    </>
  )
}
